alter table ADVANCED_ANALYTICS_2013_2014
add Player_Name varchar(50)

update ADVANCED_ANALYTICS_2013_2014
set Player_Name = case when (CHARINDEX('*',Player)) > 0 THEN SUBSTRING(Player,0,CHARINDEX('*',Player)) ELSE Player end

alter table ADVANCED_ANALYTICS_2013_2014
add Player_team varchar(50)

update ADVANCED_ANALYTICS_2013_2014
set Player_team = CONCAT(Player_Name,'_',Tm)

